import React from 'react';
import reactImg from '.../assets/images/react-core-concepts.png';

// import reactImg from '/Users/wanderwise/Desktop/React/ReactByMaximilian/01-starting-setup/src/assets/images/react-core-concepts.png';

const reactDescriptions = ['Fundamentals', 'Crucial', 'Core'];

function genRandomInt(max) {
	return Math.floor(Math.random() * (max + 1));
}
const Header = () => {
	const description = reactDescriptions[genRandomInt(2)];
	return (
		<header>
			<img src={reactImg} alt='Medal badge with a star' />
			<h1>React Essentials</h1>
			<p>{description} React concepts you will need for almost any app you are going to build!</p>
		</header>
	);
};

export default Header;
